import axios from 'axios';

const Book = () => {
  useEffect(() => {
      const fetch = async () =>{
        await axios
          .get("http://localhost:5000/api/b1/getBook")
          .then((res)=>{
            console.log(res.data.Book);  
          })
      }

  })

  return (
   <div>
      <div className="bg-dark" style={{minHeight:"91vh"}}>
          <div className="d-flex justify-context-center align-items-center py-3">
              <h4 class="text-white">Book Section</h4>
          </div>
      </div>
   </div>
  )
}

export default Book ;
